-- Tabela de Estudantes (usuários)
CREATE TABLE Estudantes (
  id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
  nome VARCHAR(100) NOT NULL,
  email VARCHAR(100) NOT NULL,
  matricula VARCHAR(20) NOT NULL,
  curso VARCHAR(100) NOT NULL,
  senha VARCHAR(100) NOT NULL,
  administrador BOOLEAN DEFAULT 0,
  foto_perfil BLOB
);


-- Tabela de Departamentos
CREATE TABLE Departamentos (
  id INT NOT NULL UNIQUE,
  nome VARCHAR(100)
);

-- Tabela de Professores
CREATE TABLE Professores (
  id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
  nome VARCHAR(100) UNIQUE,
  departamento_id INT,
  FOREIGN KEY (departamento_id) REFERENCES Departamentos(id)
);

-- Tabela de Disciplinas
CREATE TABLE Disciplinas (
  id VARCHAR(100) NOT NULL UNIQUE,
  nome VARCHAR(100),
  departamento_id INT,
  FOREIGN KEY (departamento_id) REFERENCES Departamentos(id)
);

-- Tabela de Turmas
CREATE TABLE Turmas (
  id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
  disciplina_id VARCHAR(100),
  professor_nome VARCHAR(100),
  departamento_id INT,
  total_vagas INT,
  vagas_ocupadas INT,
  horario VARCHAR(100),
  periodo VARCHAR (100),
  localizacao VARCHAR(100),
  FOREIGN KEY (disciplina_id) REFERENCES Disciplinas(id),
  FOREIGN KEY (professor_nome) REFERENCES Professores(nome),
  FOREIGN KEY (departamento_id) REFERENCES Departamentos(id)
);


-- Tabela de Avaliações
CREATE TABLE Avaliacoes (
  id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
  estudante_id INT NOT NULL,
  turma_id INT NOT NULL,
  avaliacao VARCHAR(3999) NOT NULL,
  FOREIGN KEY (estudante_id) REFERENCES Estudantes(id),
  FOREIGN KEY (turma_id) REFERENCES Turmas(id)
);

-- Tabela de Denúncias
CREATE TABLE Denuncias (
  id INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
  estudante_id INT NOT NULL,
  avaliacao_id INT NOT NULL,
  denuncia VARCHAR(3999) NOT NULL,
  FOREIGN KEY (estudante_id) REFERENCES Estudantes(id),
  FOREIGN KEY (avaliacao_id) REFERENCES Avaliacoes(id)
);

